<script setup lang="ts">
import { onMounted, ref, type HTMLAttributes } from 'vue';
import ImageLogo from '../../../public/assets/assetsadmin/logodlh.png';

defineOptions({
    inheritAttrs: false,
});

interface Props {
    className?: HTMLAttributes['class'];
}

defineProps<Props>();

const Logo = ref<String>()

async function imageUrlToBase64(url: any) {
  const response = await fetch(url);
  const blob = await response.blob(); // Get the image data as a Blob
  return new Promise((resolve, reject) => {
    const reader = new FileReader();
    reader.readAsDataURL(blob);
    reader.onloadend = () => resolve(reader.result);
    reader.onerror = error => reject(error);
  });
}

onMounted(() => {
  imageUrlToBase64(ImageLogo)
  .then((base64String:any) => {
    Logo.value = base64String
  })
  .catch(error => console.error('Error converting image from URL:', error));  
})
 
</script>

